import React from "react";
import { PostSection, PostTitle, PostTitleDiv } from "./styledComponent";

const WritePost = () => {
  return (
    <PostSection>
      <PostTitleDiv>
        <PostTitle>글쓰기</PostTitle>
      </PostTitleDiv>
    </PostSection>
  );
};

export default WritePost;
